export const styles = (theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
    paddingTop: 10,
    display: "flex",
    flexDirection: "column",
    minHeight: "92.2vh",
    alignItems: "center",
  },
});
